package com.geeks.tilek_talaibekov_hw_3_4.continent;

import android.os.Bundle;

import androidx.annotation.NonNull;
import androidx.annotation.Nullable;
import androidx.fragment.app.Fragment;
import androidx.recyclerview.widget.RecyclerView;

import android.view.LayoutInflater;
import android.view.View;
import android.view.ViewGroup;

import com.geeks.tilek_talaibekov_hw_3_4.OnItemClick;
import com.geeks.tilek_talaibekov_hw_3_4.R;
import com.geeks.tilek_talaibekov_hw_3_4.contry.CountryFragment;
import com.geeks.tilek_talaibekov_hw_3_4.databinding.FragmentContinentBinding;

import java.util.ArrayList;

public class ContinentFragment extends Fragment implements OnItemClick {
    private FragmentContinentBinding binding;
    private RecyclerView rvContinent;
    private ArrayList<ContinentModel> continentList = new ArrayList<>();


    @Override
    public View onCreateView(LayoutInflater inflater, ViewGroup container,
                             Bundle savedInstanceState) {
        binding = FragmentContinentBinding.inflate(getLayoutInflater());
        return binding.getRoot();
    }

    @Override
    public void onViewCreated(@NonNull View view, @Nullable Bundle savedInstanceState) {
        super.onViewCreated(view, savedInstanceState);
        loadData();
        ContinentAdapter adapter = new ContinentAdapter(continentList, this);
        binding.rvContinents.setAdapter(adapter);
    }

    private void loadData() {
        continentList.add(new ContinentModel("data:image/png;base64,", "Евразия"));
        continentList.add(new ContinentModel("data:image/jpeg;base64,", "Африка"));
        continentList.add(new ContinentModel("data:image/png;base64,", "Северная Америка"));
        continentList.add(new ContinentModel("data:image/png;base64,", "Южная Америка"));
        continentList.add(new ContinentModel("data:image/png;base64,", "Австралия"));
    }

    @Override
    public void onItemClick(int position) {
        Bundle bundle = new Bundle();
        bundle.putInt("key", position);
        CountryFragment countryFragment = new CountryFragment();
        countryFragment.setArguments(bundle);
        requireActivity().getSupportFragmentManager().beginTransaction()
                .replace(R.id.container, countryFragment)
                .addToBackStack(null).commit();
    }
}